import React from 'react';
import * as S from './styled';

const Header = () => {
  return (
    <header>
        <S.Wrapper>
            <input type="text" />
            <button type="submit">
                <span>Buscar</span>
            </button>
        </S.Wrapper>
    </header>
  );
};

export default Header;
